import {BrowserRouter as Router, Route, Link, Switch} from 'react-router-dom'
import Home from './components/Home';

const ConfigRouter = () => {
  return (
    <Router>
        <Switch>
          <Route exact path="/">
            <Home/>
          </Route>
        </Switch>
    </Router>
  );
}

export default ConfigRouter;
